package com.wolken.wolkenapp.DTO;

public class GunsDTO {

	private int gunsId;
	private String gunName;
	private double gunPrice;
	private String gunSerialNumber;
	private String gunBrandName;
	private String gunType;
	private int gunNoOfBullets;
	private String gunMadeIn;
	
	public GunsDTO() {
		// TODO Auto-generated constructor stub
	}

	public int getGunsId() {
		return gunsId;
	}

	public void setGunsId(int gunsId) {
		this.gunsId = gunsId;
	}

	public String getGunName() {
		return gunName;
	}

	public void setGunName(String gunName) {
		this.gunName = gunName;
	}

	public double getGunPrice() {
		return gunPrice;
	}

	public void setGunPrice(double gunPrice) {
		this.gunPrice = gunPrice;
	}

	public String getGunSerialNumber() {
		return gunSerialNumber;
	}

	public void setGunSerialNumber(String gunSerialNumber) {
		this.gunSerialNumber = gunSerialNumber;
	}

	public String getGunBrandName() {
		return gunBrandName;
	}

	public void setGunBrandName(String gunBrandName) {
		this.gunBrandName = gunBrandName;
	}

	public String getGunType() {
		return gunType;
	}

	public void setGunType(String gunType) {
		this.gunType = gunType;
	}

	public int getGunNoOfBullets() {
		return gunNoOfBullets;
	}

	public void setGunNoOfBullets(int gunNoOfBullets) {
		this.gunNoOfBullets = gunNoOfBullets;
	}

	public String getGunMadeIn() {
		return gunMadeIn;
	}

	public void setGunMadeIn(String gunMadeIn) {
		this.gunMadeIn = gunMadeIn;
	}

}
